  { firstName: "jane20",  age: 20 },
  { firstName: "jane21",  age: 20 },
  { firstName: "jane22",  age: 20 },
  { firstName: "jane23",  age: 20 },
  { firstName: "jane24",  age: 20 },
  { firstName: "jane25",  age: 20 },
  { firstName: "jane26",  age: 20 },
  { firstName: "jane27",  age: 20 },
  { firstName: "jane28",  age: 20 },
  { firstName: "jane29",  age: 20 },
  { firstName: "jane30",  age: 20 },
  { firstName: "jane31",  age: 20 },
];

const columns = [
  {
    Header: "Name",
    accessor: "firstName"
  },
  {
    Header: "Other Info",
    accessor: "age"
  }
];

const Clientes = () => {

const [setData] = React.useState([]);
const [skipPageReset, setSkipPageReset] = React.useState(false);

// When our cell renderer calls updateMyData, we'll use
  // the rowIndex, columnId and new value to update the
  // original data
  const updateMyData = (rowIndex, columnId, value) => {
    // We also turn on the flag to not reset the page
    setSkipPageReset(true)
    setData(old =>
      old.map((row, index) => {
        if (index === rowIndex) {
          return {
            ...old[rowIndex],
            [columnId]: value,
          }
        }
        return row
      })
    )
  }

  return (
    <div className="Clientes">
      <Card className='Card'>
        <CardContent>
          Clientes
        </CardContent>
        <Button size="small">Incluir</Button>
      </Card>

    <CssBaseline />
     <EnhancedTable
        columns={columns}
        data={data}
        setData={setData}
        updateMyData={updateMyData}
        skipPageReset={skipPageReset}
      />
    </div>
  );
}

export default Clientes;
